import React from 'react';
import { Typography } from 'antd';

const { Title } = Typography;

function CarouContent() {

  const style: React.CSSProperties = {
    top: 0,
    left: 0,
    position: 'absolute',
  };

  return (<>
    <div className="w-100 h-100" style={style}>
      
    </div>
  </>);
}
export default CarouContent;
